import { SidebarComponent } from "./SidebarComponent";

function MainComponent(props) {
    return (
        <div className="main">
            <SidebarComponent/>
            <div className="right">
                <h2>{props.main.rightTitle}</h2>
                <p>{props.main.insideText}</p>
            </div>
        </div>
    )
}

export default MainComponent;
